import React, { useState } from "react";

function App() {

  const [count, setCount] = useState(0)

  function Up(){
    setCount(count + 1);
  }

  function Down(){
    setCount(count - 1);
  }

  return (
    <div className="App">
      Hahahaha
      <h2>{count}</h2>
      <button onClick={Up}>Up</button>
      <button onClick={Down}>Down</button>
    </div>
  );
}

export default App;
